import React, { useEffect } from "react";
import Aos from "aos";
import "aos/dist/aos.css";

const About = () => {
    useEffect(() => {
        Aos.init({ duration: 2000 });
    }, [])
    return (
        <div className="App">
            <h1>About</h1>
            <div className="Grid">
                <div className="boxes">1</div>
                <div className="boxes">2</div>
                <div className="boxes">1</div>
            </div>
        </div>
    )
};
export default About;
